Fetprofile.create([
  { :id => 1, :vorname => "Andreas", :nachname => "Stephanides", :short => "andis", :fetmailalias => "", :desc => "Aufgabenbereich reicht vom Dolmetschen für Andi D bis zum photographischen Festhalten von Situationen die besser undokumentiert bleiben sollten. Als Doppelstudent auf der WU kennt er außer der Ladungserhaltung noch andere Gesetze. Trägt gern gefragt und ungefragt juristische Skurrilitäten zur Diskussion bei und weiß TATSÄCHLICH alles besser als alle anderen. ", :picture => "IMG_9090.jpg", :active => true, :created_at => "2013-08-22 20:39:29", :updated_at => "2013-08-22 20:44:59" },
  { :id => 2, :vorname => "Johanna", :nachname => "Spreitzhofer", :short => "johanna", :fetmailalias => "", :desc => "der vegetarische Eisbär, braucht selbst bei 30° eine Decke. Sie vertritt mit vollem Einsatz die Interessen der ET-StudentenInnen in unserer Studienkomission und ist außerdem eine unserer beiden FET-Chefinnen. Als Schaf-Fan hat sie den letzten ÖH - Wahlkampf sehr genossen. Dank ihrer beeindruckenden rhetorischen Fähigkeiten bringt sie erschöpfte Gruppen von Student_innen dazu, vom \"big fat pony\" zu singen.", :picture => "johanna.JPG", :active => true, :created_at => "2013-08-25 17:51:37", :updated_at => "2013-08-25 17:54:17" },
  { :id => 3, :vorname => "Bernhard", :nachname => "Stampfer", :short => "berni", :fetmailalias => "", :desc => "\"98 Punkte\"-Berni gilt als einziger Messtechnikexperte seines Jahrgangs. Als tiroler Alpenbewohner erträgt er das milde mitteleuropäische Flachlandklima nur in kurzen Hosen. Der Umstand, dass quasi alle BesucherInnen? der Fachschaftsräumlichenkeiten unseren Berni kennen, liegt an seiner beinahe unheimlichen Anwesenheitsrate und am ausgeprägten tiroler Akzent. Sollte es wider erwarten mit dem Studium nichts werden, könnte es immer noch zur Synchronstimme für 56k-Modems reichen.", :picture => "Bernhard.JPG", :active => true, :created_at => "2013-08-25 17:55:32", :updated_at => "2013-08-25 17:55:32" },
  { :id => 4, :vorname => "Isabella", :nachname => "Schmied", :short => "Isi", :fetmailalias => "", :desc => "entflieht dem grauslichen grauen Wiener Wetter nur allzu gern in fremde Länder. Nichts desto trotz engagiert sie sich in der StuKo? für Materialwissenschaften und steht ihren Mitstudierenden beim Servicedienst immer mit Rat und Tat zur Seite. Dank der ÖH-Wahl wurde sie außerdem zur neuen Schaf-Mal-Expertin. ", :picture => "Isi.jpg", :active => true, :created_at => "2013-08-25 17:57:17", :updated_at => "2013-09-26 08:21:44" },
  { :id => 5, :vorname => "Patrik", :nachname => "Zips", :short => "patrik", :fetmailalias => "", :desc => "ist hochintelligent, fesch, sportlich, lernt für Prüfungen maximal 2 tage, kennt das Wiener Nachtleben wie kein anderer und fährt auch ab und zu Notarztwagen. Trotzdem lassen wir ihn in dem Glauben, dass wir ihn mögen.", :picture => "PatrikZips.JPG", :active => false, :created_at => "2013-08-25 18:01:02", :updated_at => "2013-08-25 18:01:02" },
  { :id => 6, :vorname => "Andreas", :nachname => "Deutschmann", :short => "philo", :fetmailalias => "", :desc => "der philosophische ET-Student erklärt Fremdwörter mit fremderen Wörtern. Er lebt den Unterschied zwischen g33k und n3rd und kennt gerüchteweiße keine Pausen sondern nur alternative Arbeit. Das ist wohl auch der Grund, warum er inzwischen in jedem zweiten Gremium irgendwie beteiligt ist. Als hilfsbereite Anlaufstelle auf der Fachschaft für mathematische Probleme, kann er auf acht A4 Seiten zeigen, wie trivial diese sind – würde er nicht abends regelmäßig die Gitarre auspacken, müsste man sich Sorgen machen.", :picture => "andid.jpg", :active => true, :created_at => "2013-08-25 18:08:59", :updated_at => "2013-08-25 18:08:59" },
  { :id => 7, :vorname => "Martin", :nachname => "Meiringer", :short => "madn", :fetmailalias => "", :desc => "unser garstiger Waldviertler fährt für den neuen IKEA-Katalog nach Skandinavien und geht auch zu später Stunde noch in die Infrarotkabine. Als einer unserer drei M&Ms positioniert er sich als Kings- und Wikingerfunk Verweigerer und verflucht die Übungen auf Kroatisch. Der Standard-Kommentare-Bewerter führte seine Gruppe mit dem Sadomaso-Zwerg zum Sieg.", :picture => "madn.jpg", :active => true, :created_at => "2013-08-25 18:15:54", :updated_at => "2013-08-25 18:32:02" },
  { :id => 8, :vorname => "Andreas", :nachname => "Greil", :short => "andi", :fetmailalias => "", :desc => "war Vorsitzender der Fachschaft. Andi ist der lebende Beweis dafür, dass man ein kleiner Mann in der FET sein und trotzdem schnell studieren kann. Als Spitzenkoch ist er durch kontinuierlich kulinarische Nutzung der FET Küche verantwortlich für zunehmenden Bauchumfang vieler Elektrotechnik Studierenden. Mit seiner Umgänglichkeit und Fähigkeit, jeden mit Begeisterung jederzeit zu motivieren, setzt er auf der Fachschaft Maßstäbe die seines gleichen sucht. ", :picture => "greil.png", :active => false, :created_at => "2013-09-10 20:40:23", :updated_at => "2013-09-10 20:40:23" },
  { :id => 9, :vorname => "Clemens", :nachname => "Kelemen", :short => "clemens", :fetmailalias => "", :desc => "Böse Zungen behaupten hartnäckig, er komme von der falschen Seite der Donau. Dort bei die Mückenzüchter. Er selbst bezeichnet sich eher als 1210er, und als sympathischer noch dazu – Recht hat er. Innerhalb der Fachschaft ist er inzwischen an vorderster Front des Fetzn-Layout-Teams und ist damit nicht unwesentlich für diese Zeilen verantwortlich. Weiters ist er der Gitarrenstreichler-Fraktion zuzuordnen. ", :picture => "clemens.jpg", :active => true, :created_at => "2013-09-16 06:37:32", :updated_at => "2013-09-16 06:37:32" }
], :without_protection => true )



