Frage.create([
  { :title => "Was ist das Erstsemestrigen-Tutorium?", :text => "Bla blub", :id => 1, :created_at => "2013-08-21 14:40:52", :updated_at => "2013-08-21 14:40:52", :thema_id => 2 },
