Modul.create([
  { :desc => "<p>Im Modul Mechatronische Systeme werden Methoden des Systemdesigns und der<br />Systemintegration behandelt, sowie g&auml;ngige Automatisierungskomponenten vorgestellt. Bei den<br />Aktuator- und Sensorprinzipien stehen vor allem die f&uuml;r die Pr&auml;zisions- und Hochtechnologie<br />wichtigen Systeme im Vordergrund. Das Modul gliedert sich in einen Vorlesungsteil mit<br />&Uuml;bungen und einen Laborteil.</p>", :depend => "", :name => "Mechatronische Systeme", :id => 3, :created_at => "2013-03-02 13:20:02", :updated_at => "2013-08-19 17:08:20" },
  { :desc => "<p>Das Modul baut auf der VU &bdquo;Maschinen und Antriebe&ldquo; des Bachelorstudiums auf und vermittelt grundlegendes Wissen &uuml;ber Transformatoren (Basis Zeitzeigerrechnung), Asynchronmaschinen (Basis Raumzeigerrechnung) und synchron laufende Maschinen (Basis Raumzeigerrechnung und Zweiachsentheorie) und deren Anwendung in Antriebssystemen.</p>", :depend => "", :name => "Antriebstechnik", :id => 4, :created_at => "2013-03-02 23:09:01", :updated_at => "2013-03-20 16:31:21" },
  { :desc => "<p>Automatisierte Systeme sind aus unserem t&auml;glichen Leben nicht mehr wegzudenken, sei es in<br />der Unterhaltungselektronik, im Auto, in der U-Bahn, im Stra&szlig;enverkehr, in Geb&auml;uden,<br />Kraftwerken oder Produktionsanlagen. In all den genannten Bereichen beruhen innovative neue<br />Funktionen auf Automation (z.B. automatische Spurerkennung von Fahrzeugen). Die<br />Leistungselektronik spielt als Schnittstelle zum automatisierten Prozess eine ebenso gro&szlig;e<br />Rolle und ist eine grundlegende Voraussetzung f&uuml;r den Betrieb moderner elektrischer Antriebe,<br />f&uuml;r Stromversorgungen und viele andere Anwendungen in der Industrie. Dieses Modul vermittelt<br />den grundlegenden Aufbau, die Funktion und Methoden f&uuml;r den Entwurf von automatisierten<br />Systemen sowie der Leistungselektronik.</p>", :depend => "", :name => "Automation", :id => 7, :created_at => "2013-03-18 17:33:28", :updated_at => "2013-03-18 19:29:39" },
  { :desc => "<p>Das Modul Optimale Systeme beinhaltet die grundlegenden mathematischen Konzepte der Optimierungstheorie sowie deren Anwendung im Bereich der Automatisierungs- und Regelungstechnik. Im Speziellen werden optimierungsbasierte Verfahren f&uuml;r die Systemidentifikation, den Steuerungs- und Regelungsentwurf und den Beobachterentwurf behandelt und anhand von konkreten Laborversuchen unter Verwendung moderner Software- und Automatisierungssysteme angewandt.</p>", :depend => "", :name => "Optimale Systeme", :id => 12, :created_at => "2013-03-18 17:48:23", :updated_at => "2013-03-24 13:11:12" },
  { :desc => "<p>Zum Verst&auml;ndnis von Energiesystemen sind die grundlegenden Prinzipien der konventionellen,<br />oft fossilen Energiewandlung genauso wichtig wie die regenerative Energiewandlung durch<br />erneuerbare Energietr&auml;ger und die Wandlung der elektrischen Energie in rotierenden<br />Maschinen. Das Modul vermittelt das Wissen &uuml;ber eine nachhaltig umweltfreundliche,<br />zuverl&auml;ssige und wirtschaftliche Energiewandlung.</p>", :depend => "", :name => "Energiewandlung", :id => 13, :created_at => "2013-03-18 17:49:48", :updated_at => "2013-03-18 17:49:48" },
  { :desc => "<p>Die fundamentale Motivation f&uuml;r dieses Modul ist, den Stellenwert und die Relevanz von<br />Energie, Energiesystemen und technologischem Fortschritt f&uuml;r die Gesellschaft und das<br />Wirtschaftssystem zu vermitteln. Das zentrale Ziel ist es, Wege aufzuzeigen, wie aus<br />gesellschaftlicher Sicht Energie in einem dynamischen Prozess optimal, nachhaltig und<br />umweltfreundlich genutzt werden kann. </p>", :depend => "", :name => "Energiewirtschaft und Umwelt", :id => 14, :created_at => "2013-03-18 17:51:41", :updated_at => "2013-03-18 17:51:41" },
  { :desc => "<p>Es vermittelt die Kenntnisse zur Projektierung, Entwicklung, Berechnung und Analyse von<br />Systemen der Energie&uuml;bertragung sowie der dabei verwendeten Komponenten und<br />Technologien, der Technik hoher Spannungen und der elektromagnetischen Vertr&auml;glichkeit.<br />Verfahren zur Modellierung und Simulation solcher Systeme werden ebenfalls vermittelt.</p>", :depend => "", :name => "Energieübertragung", :id => 16, :created_at => "2013-03-18 18:03:17", :updated_at => "2013-03-18 18:03:17" },
  { :desc => "<p>Das Modul Modellierung und Regelung Vertiefung behandelt fortgeschrittene Konzepte der mathematischen Modellierung, Analyse, Simulation, Regelung und des Beobachterentwurfes komplexer dynamischer Systeme unterschiedlicher physikalischer Dom&auml;nen mit finit- und infinitdimensionalem Zustand.</p>", :depend => "", :name => "Modellierung und Regelung Vertiefung", :id => 17, :created_at => "2013-03-18 18:04:53", :updated_at => "2013-03-18 21:44:53" },
  { :desc => "<p>Im Modul Precision Engineering werden Methoden der Pr&auml;zisionstechnologie, insbesondere zur Instrumentierung f&uuml;r die Nanotechnologie und optischen Messtechnik, vertiefend vorgetragen und analysiert, sowie das Arbeiten mit Pr&auml;zisionsmesssystemen im Labor ge&uuml;bt. Das Modul gliedert sich in je einen Vorlesungsteil mit angeschlossenem Labor zur Nanomesstechnik und zur optischen Messtechnik.</p>", :depend => "", :name => "Precision Engineering", :id => 18, :created_at => "2013-03-18 21:39:36", :updated_at => "2013-03-18 21:39:36" },
  { :desc => "<p>Ziel dieses Wahlmoduls ist es, Studierende in individuellen Projekten an das wissenschaftliche Arbeiten heranzuf&uuml;hren und in Grundlagen der Projektplanung und Projektorganisation zu schulen.</p>", :depend => "", :name => "Industrielle Automation Projekt", :id => 19, :created_at => "2013-03-18 21:40:14", :updated_at => "2013-03-18 21:40:14" },
  { :desc => "<p>Das Modul bietet einen Einblick in Bildverarbeitung im Einsatz in der industriellen Robotik und Automatisierungstechnik und in aktuelle Kapitel der Forschung. Im Zuge von Vertiefungsarbeiten wird der Stand der Technik vertieft und auf das selbstst&auml;ndige Durchf&uuml;hren von wissenschaftlichen Arbeiten vorbereitet.</p>", :depend => "", :name => "Robot Vision", :id => 20, :created_at => "2013-03-18 21:40:49", :updated_at => "2013-03-18 21:40:49" },
  { :desc => "<p>Dieses Modul vermittelt vermittelt grundlegendes Wissen &uuml;ber Theorie und Methoden der digitalen Signalverarbeitung in deterministischen und stochastischen Systemmodellen.</p>", :depend => "", :name => "Signal Processing (Signalverarbeitung)", :id => 21, :created_at => "2013-03-18 21:41:24", :updated_at => "2013-03-18 21:41:24" },
  { :desc => "<p>Das Modul Bioprozesstechnologie vermittelt Wissen &uuml;ber die grundlegenden Aufgabenstellungen und Funktionsweisen der (bio)chemischen Messtechnik, der multivariaten Experimentalplanung und der Modellierung f&uuml;r die Entwicklung von Prozessen in der Biotechnologie. Es stellt daher eine Anwendung der grundlegenden Disziplinen der Automatisierungstechnik und Prozessierung auf eine zukunftsorientierte hoch interdisziplin&auml;re Technologie dar.</p>", :depend => "", :name => "Bioprozesstechnologie", :id => 22, :created_at => "2013-03-18 21:42:37", :updated_at => "2013-03-18 21:42:37" },
  { :desc => "<p>Dieses Modul vertieft die Grundlagen der in der VU Machine Vision und kognitive Robotik erarbeiteten Inhalte von Computer Vision. Vertiefende Konzepte der 2D Bildverarbeitung, 3D Bildverarbeitung und Videoanalyse sowie Objekterkennung in visuellen Daten sind Kerninhalt dieses Moduls, das ein tiefergehendes Verst&auml;ndnis der Basiskonzepte der Computer Vision zum Ziel hat.</p>", :depend => "", :name => "Computer Vision", :id => 23, :created_at => "2013-03-18 21:43:13", :updated_at => "2013-03-18 21:43:13" },
  { :desc => "<p>Das Modul ist eine Vertiefung zur Basisvorlesung &bdquo;Leistungselektronik und Stromrichtertechnik&ldquo; (Pflichtmodul Automatisierungstechnik). Es erg&auml;nzt bzw. vertieft den Stoff der Basisvorlesung in Richtung elektronischer Stromversorgungen (AC/DC-Konverter), Pulswechselrichter sowie aktiver Gleichrichter. Ein Schwerpunkt liegt auch in der EMV-Problematik, die f&uuml;r Entwurf und Realisierung leistungselektronischer Schaltungen und Systeme von gro&szlig;er Wichtigkeit ist.</p>", :depend => "", :name => "Leistungselektronik und EMV", :id => 24, :created_at => "2013-03-18 21:44:19", :updated_at => "2013-03-18 21:44:19" },
  { :desc => "<p>Das Modul Regelungssysteme behandelt die Modellierung, die Analyse und den Regelungsentwurf nichtlinearer komplexer dynamischer Systeme und die Anwendung der kompletten Entwurfskette beginnend bei der physikalisch basierten Modellierung, &uuml;ber die Systemidentifikation bis hin zum Regler- und Beobachterentwurf f&uuml;r (nichtlineare) Mehrgr&ouml;&szlig;ensysteme anhand von konkreten Laborversuchen und unter Verwendung moderner Software- und Automatisierungssysteme.</p>", :depend => "", :name => "Regelungssysteme", :id => 25, :created_at => "2013-03-24 13:08:34", :updated_at => "2013-03-24 13:08:34" },
  { :desc => "<p>Das Modul pr&auml;sentiert die Grundlagen der Sensorik mit Schwerpunkt auf der Bildverarbeitung und Objekterkennung f&uuml;r den Einsatz in der Automatisierungstechnik und Robotik und behandelt die Grundkonzepte kognitiver Systeme und Roboter in diesem Kontext.</p>", :depend => "", :name => "Sensorik und Robotik", :id => 26, :created_at => "2013-03-24 13:09:30", :updated_at => "2013-03-24 13:09:30" },
  { :desc => "<p>Informations- und Kommunikationstechnik ist ein zentraler Bestandteil von intelligenten Energienetzen (Smart Grids). Das Modul vermittelt die grundlegenden Technologien und Hilfsmittel, die zum Verst&auml;ndnis und zur Weiterentwicklung der Informations- und Kommunikationstechnik in Energienetzen und zur Gestaltung von Smart Grids notwendig sind.</p>", :depend => "", :name => "IKT in Energienetzen", :id => 27, :created_at => "2013-03-24 13:10:27", :updated_at => "2013-03-24 13:10:27" },
  { :desc => "<p>Das Wahlmodul Antriebstechnik Vertiefung ben&uuml;tzt den Stoff der Pflichtlehrveranstaltung &bdquo;Elektrische Antriebe&ldquo;, um konkrete Antriebsaufgaben zu l&ouml;sen. Dabei wird auf die praktische Anwendung gro&szlig;er Wert gelegt. Ziel des Wahlmoduls ist die konkrete Umsetzung eines Antriebsproblems in eine L&ouml;sung.</p>", :depend => "", :name => "Antriebstechnik Vertiefung", :id => 28, :created_at => "2013-03-24 13:13:01", :updated_at => "2013-03-24 13:13:01" },
  { :desc => "<p>Das Modul behandelt mathematischen Modellbildung und numerischen Methoden. Der Inhalt umfasst gew&ouml;hnlichen und partiellen Differentialgleichungen, Differential-Algebraische Gleichungen, objektorientierte Modellierung, diskrete Modellierung, hybride Modellierung sowie Stabilit&auml;t von numerischen Algorithmen, Numerik von gew&ouml;hnlichen und partiellen Differentialgleichungen, Linienmethode, Diskretisierungsverfahren und Numerik von Randwertproblemen. Die Themengebiete sollen sowohl theoretisch als auch praktisch behandelt werden.</p>", :depend => "", :name => "Mathematische Methoden", :id => 29, :created_at => "2013-03-24 13:13:27", :updated_at => "2013-03-24 13:13:27" },
  { :desc => "<p>Einf&uuml;hrung in die Grundlagen analoger und digitaler integrierter Schaltungen, analoge integrier-</p>\r\n<p>te Bipolar-, CMOS- und BiCMOS-Schaltungen, Methoden zur Verbesserung des Matchings,</p>\r\n<p>Methodik zu Entwurf und Dimensionierung analoger ICs, Simulation integrierter Schaltungen,</p>\r\n<p>Entwurf digitaler Schaltungen mittels VHDL und auf Registertransferebene, Methoden und Algo-</p>\r\n<p>rithmen f&uuml;r die Synthese digitaler Schaltungen.</p>\r\n<p>&nbsp;</p>", :depend => "", :name => "Integrierte Schaltungen", :id => 30, :created_at => "2013-08-19 19:34:59", :updated_at => "2013-08-19 19:34:59" },
  { :desc => "<p>Ein Verst&auml;ndnis der Optoelektronik, Lasertechnik sowie der optischen Kommunikationstechnik</p>\r\n<p>ist f&uuml;r praktisch alle Bereiche der modernen Mikroelektronik und Informationstechnologie uner-</p>\r\n<p>l&auml;sslich. Aufbauend auf einschl&auml;giges Bachelorwissen aus Elektrodynamik, Wellenausbreitung,</p>\r\n<p>Signale und Systeme, Festk&ouml;rperelektronik und Photonik vermittelt dieses Modul fortgeschritte-</p>\r\n<p>ne Kenntnis und F&auml;higkeit zur Analyse von modernen photonischen Verfahren, Technologien</p>\r\n<p>und Systemen.</p>\r\n<p>&nbsp;</p>", :depend => "", :name => "Photonik und Quantenelektronik", :id => 31, :created_at => "2013-08-19 19:39:42", :updated_at => "2013-08-19 19:39:42" }
], :without_protection => true )



