  { :title => "Zulassungsvoraussetzungen für ein Masterstudium", :text => "<p>Der Bachelor an der TU Wien berechtigt ohne weiteres zur Inskription eines Masters der Fakult&auml;t. Au&szlig;erdem zur Zulassung zu technischer Mathematik und ...</p>\r\n<p>ohne weitere Pr&uuml;fungen nachzuholen.</p>\r\n<p>F&uuml;r Studenten die einen Bachelor Elektrotechnik an einer anderen europ&auml;ischen Universit&auml;t gemacht haben gelten folgende Regeln...</p>\r\n<p>Studenten aus Drittstaaten (nicht EU) gilt, dass ...</p>", :id => 12, :created_at => "2013-08-22 20:19:36", :updated_at => "2013-08-22 20:19:36", :themengruppe_id => 5 },
  { :title => "Studienübersicht", :text => "<div class=\"mxgraph\" style=\"position: relative; overflow: hidden; width: 702px; height: 572px;\">\r\n<div style=\"width: 1px; height: 1px; overflow: hidden;\"><a href=\"attachments/2/edit\">Klassendiagram drawio Studien</a></div>\r\n</div>\r\n<script type=\"text/javascript\" src=\"http://drawdotio.appspot.com/embed.js\"></script>\r\n<p>&nbsp;<a href=\"../../../themen/13/attachments/2\">Klassendiagram drawio Studien</a></p>", :id => 13, :created_at => "2013-08-24 05:02:40", :updated_at => "2013-08-24 05:07:47", :themengruppe_id => 6 },
  { :title => "Alpha Testphase", :text => "<p>W&auml;hrend der Alpha Testphase ist noch nicht die endg&uuml;ltige Datenbank im Betrieb und es werden regelm&auml;&szlig;ig neue Features implementiert. Es sollten noch <strong>keine Daten f&uuml;r den echten Betrieb</strong> eingepflegt werden!Die verschiedenen <strong>Funktionen sollten ausgiebig getestet werden</strong> und Feedback und Bugreports auf der Github Seite gemeldet. <strong>Rechtemanagement wird erst am Ende der Alpha Phase implementiert</strong> bis dahin hat jeder User alle Berechtigungen auf dieser Seite</p>", :id => 14, :created_at => "2013-08-24 09:07:20", :updated_at => "2013-08-24 09:07:36", :themengruppe_id => 6 },
  { :title => "Übergangsbestimmungen", :text => "<p>&Uuml;bergangsbestimmungen</p>\r\n<p><a href=\"../../../uploads/attachment/datei/4/Uebergang-Bachelor-2011.pdf\">&Uuml;bergangsregelungen Bachelor</a></p>", :id => 15, :created_at => "2013-08-24 14:22:53", :updated_at => "2013-08-24 15:01:17", :themengruppe_id => 1 },
  { :title => "Zulassungsvoraussetzungen für das Bachelorstudium Elektrotechnik und Informationstechnik", :text => "<p>F&uuml;r eine Zulassung ist die allgemeine und spezielle Universit&auml;tsreife Voraussetzung. In &Ouml;sterreich ist das durch eine Matura, eine Studienberechtigungspr&uuml;fung oder einen &auml;quivalenten Abschluss gegeben. F&uuml;r Unionsb&uuml;rger gilt der &auml;quivalente Abschluss im eigenen Land. F&uuml;r Kollegen und Kolleginnen aus Deutschland ist das das Abi.</p>\r\n<p>An der TU Wien gibt es f&uuml;r Elektrotechnik und Informationstechnik keinen eigenen Aufnahmetest. Es gibt aber einen Self Assesment Test der bei der Entscheidung helfen soll <a href=\"http://studienwahl.tuwien.ac.at/selfassessment/\">http://studienwahl.tuwien.ac.at/selfassessment</a>.&nbsp;Das Ergebnis hat aber keine formalen Auswirkungen, Interesse f&uuml;r Elektrotechnik hat hier sicher mehr Aussagekraft als der Test.</p>", :id => 16, :created_at => "2013-09-24 12:58:11", :updated_at => "2013-09-24 13:04:05", :themengruppe_id => 5 },
  { :title => "Lokalführer", :text => "<p>&nbsp;</p>\r\n<p><object data=\"http://glonass.htu.tuwien.ac.at/WienSvgKarte.svg\" type=\"image/svg+xml\" width=\"600\" height=\"400\"> Die Bezirkskarte erfordert SVG-Unterst&uuml;tzung in deinem Browser. Benutze ein anderes Register. </object></p>\r\n<p>&nbsp;</p>\r\n<div id=\"BezirkCarousel\" class=\"carousel slide\"><!-- Carousel items -->\r\n<div class=\"carousel-inner\"><br /><br /><br /> <a class=\"carousel-control left\" href=\"#BezirkCarousel\" data-slide=\"prev\">&lsaquo;</a> <a class=\"carousel-control right\" href=\"#BezirkCarousel\" data-slide=\"next\">&rsaquo;</a></div>\r\n<div class=\"carousel-inner\">\r\n<div class=\"active item\">\r\n<h1>1. Bezirk</h1>\r\n<h2>&nbsp;Kolar</h2>\r\n<p>Das Kolar in der Kleeblattgasse ist ein uriges Lokal zum Essen von Fladen die jedem schmecken.</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>2. Bezirk</h1>\r\n<p><a onclick=\"$('#BezirkCarousel').carousel(0)\" href=\"#\">sdfd</a></p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>3. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>4. Bezirk</h1>\r\n<h2>&nbsp;Schikaneder</h2>\r\n<p>BlaBlaBla</p>\r\n<p>sdf</p>\r\n<p>wferw</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>5. Bezirk</h1>\r\n<p>&nbsp;sdfsdfsdfsdf</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>6. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>7. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>8. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>9. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>10. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>11. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>12. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>13. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>14. Bezirk</h1>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"item\">\r\n<h1>15. Bezirk</h1>\r\n<p